var informationNotificationCss="\n<h5>Containers</h5>\n<code>\n<pre>\n/* Containers */\n.information-notification {\n  background: #e5edf7;\n  border-top: 4px solid #b3c1d7;\n  color: #333333;\n}\n.information-notification-content {\n  display: flex;\n  padding: 24px;\n}\n.information-notification .icon-container {\n  border-radius: 50%;\n  height: auto;\n  justify-self: center;\n  width: auto;\n  align-self: flex-start;\n  display: flex;\n  min-width: 56px;\n}\n</pre>\n</code>\n\n<h5>Text</h5>\n<code>\n<pre>\n/* Text */\n.information-notification .description {\n  color: #333333;\n  font-family: \"Open Sans\", sans-serif;\n  font-size: 16px;\n  line-height: 1.78;\n  letter-spacing: 0.2px;\n  margin: 0;\n  padding: 8px 0 0 16px;\n}\n</pre>\n</code>\n\n<h5>Icons</h5>\n<code>\n<pre>\n/* Icons */\n.information-notification .close-icon {\n  display: flex;\n  justify-content: flex-end;\n  padding: 17px;\n  box-sizing: border-box;\n  position: absolute;\n  right: 8px;\n}\n.information-notification .close-icon svg:hover {\n  cursor: pointer;\n}\n.information-notification .icon-container .icon {\n  height: 56px;\n  width: 56px;\n  display: inline-block;\n  line-height: 0;\n  position: relative;\n  right: 0;\n}\n</pre>\n</code>\n\n<h5>Media Query</h5>\n<code>\n<pre>\n/* Media Query */\n@media (max-width: 576px) {\n  .information-notification .description {\n    font-size: 14px;\n    padding-top: 16px;\n  }\n  .information-notification .icon-container {\n    min-width: 32px;\n    align-self: center;\n  }\n  .information-notification .icon-container .icon {\n    width: 32px;\n    height: 32px;\n  }\n  .information-notification-content {\n    flex-direction: column;\n  }\n}\n</pre>\n</code>\n";$(".information-notification-code .css-code").html(informationNotificationCss); //Confirmation Notification
