var crossSiteHeaderCss=" \n<h5>Containers</h5>\n<code>\n<pre>\n/* Containers */\n.cross-site-navigation {\n  width: 100%;\n  display: flex;\n  justify-content: center;\n  align-content: center;\n  flex-direction: column;\n}\n.cross-site-links-container {\n  background: #18335c;\n  display: flex;\n  justify-content: center;\n  align-content: center;\n  padding: 10px 40px;\n}\n.cross-site-links-container-content {\n  align-items: center;\n  line-height: normal;\n  background: #18335c;\n  display: flex;\n  justify-content: space-between;\n  width: 1140px;\n}\n.cross-site-links-container-content .home-link {\n  display: flex;\n}\n.cross-site-navigation .svg-container {\n  display: flex;\n  align-items: center;\n}\n.cross-site-logo-container {\n  background: #254f90;\n  padding: 32px 40px;\n  display: flex;\n  justify-content: center;\n  align-content: center;\n}\n.cross-site-logo-container-content {\n  width: 1140px;\n  display: flex;\n  align-content: center;\n  justify-content: flex-start;\n}\n</pre>\n</code>\n\n<h5>Text</h5>\n<code>\n<pre>\n/* Text */\n.cross-site-links-container-content h4,\n.cross-site-links-container-content a {\n  color: #ffffff;\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 400;\n  font-style: normal;\n  font-size: 16px;\n  margin: 0;\n  text-decoration: none;\n}\n.cross-site-logo-container-content h1 {\n  color: #fff;\n  font-weight: 700;\n  font-size: 22px;\n  font-family: \"Open Sans\", sans-serif;\n  padding: 0 0 0 14px;\n  margin: 0;\n  max-width: 120px;\n  align-self: center;\n}\n</pre>\n</code>\n\n<h5>SVG's</h5>\n<code>\n<pre>\n/* svg's */\n.cross-site-links-container-content .home-link svg {\n  padding-right: 14px;\n  min-width: 10px;\n  min-height: 16px;\n}\n.cross-site-logo-container-content .svg-container svg {\n  min-width: 103.326px;\n  min-height: 44.63px;\n}\n</pre>\n</code>\n";$(".cross-site-header-code .css-code").html(crossSiteHeaderCss); //STEPPED NAVIGATION
