var steppedNavigationCss=" \n<h4>Desktop</h4>    \n<h5>Link text (completed and current steps)</h5>\n<code>\n<pre>a {\n    color: #254F90;\n    font-family: OpenSans-Semibold;\n    font-size: 14px;\n    line-height: 20px;\n    text-decoration: none;\n}\n</pre>\n</code>\n    \n<h5>Link text (uncompleted steps)</h5>\n<code>\n<pre>a {\n    color: #666666;\n    font-family: OpenSans;\n    font-size: 14px;\n    line-height: 20px;\n    text-decoration: none;\n}\n</pre>\n</code>\n    \n<h5>Link icon (completed step)</h5>\n<code>\n<pre>.icon {\n    color: #FFFFFF;\n    width: 14px;\n    height: 12px;\n}\n.icon-container {\n    background-color: #254F90;\n    width: 32px;\n    height: 32px;\n    border: #254F90 solid 2.5px;\n    border-radius: 50%;\n}\n</pre>\n</code>\n    \n<h5>Link number (current step)</h5>\n<code>\n<pre>.number {\n    color: #254F90;\n    font-family: OpenSans-Semibold;\n    font-size: 16px;\n    line-height: 30px;\n}\n.number-container {\n    background-color: #FFFFFF;\n    width: 32px;\n    height: 32px;\n    border: #254F90 solid 2.5px;\n    border-radius: 50%;\n}\n</pre>\n</code>\n    \n<h5>Link number (uncompleted step)</h5>\n<code>\n<pre>.number {\n    color: #666666;\n    font-family: OpenSans-Semibold;\n    font-size: 16px;\n    line-height: 30px;\n}\n.number-container {\n    background-color: #FFFFFF;\n    width: 32px;\n    height: 32px;\n    border: #C7C7C7 solid 2.5px;\n    border-radius: 50%;\n}\n</pre>\n</code>\n    \n<h5>Background line (completed steps)</h5>\n<code>\n<pre>.line {\n    color: #254F90;\n    height: 2.5px;\n}\n</pre>\n</code>\n    \n<h5>Background line (uncompleted steps)</h5>\n<code>\n<pre>.line {\n    color: #C7C7C7;\n    height: 2.5px;\n}\n</pre>\n</code>\n    \n    \n<h5>Stepped navigation container (optional)</h5>\n<code>\n<pre>.container {\n    background-color: #EBEBEB;\n    padding-top: 32px;\n    padding-top: 32px;\n}\n</pre>\n</code>\n";$(".stepped-navigation-code .css-code").html(steppedNavigationCss); //CHECKLIST
